import React from 'react';

function MainContent({ onNavigate }) {
    const handleStartClick = () => {
      onNavigate('Interface1'); // Navigation vers Interface1 sur clic du bouton
    };    return (
        <div className="main-content">
            <h1>
                <span className="highlight">Combien</span> de débit INTERNET ai-je besoin?
            </h1>
            <p>Dites-nous comment vous utilisez Internet et nous vous recommandons une vitesse Internet appropriée.</p>
            <div className="table-container">
                <div className="table-row">
                    <div className="table-cell">
                        <h2>Résidentiel</h2>
                        <button className="btn" onClick={onStartClick}>Commencer</button>
                    </div>
                    <div className="table-cell">
                        <h2>Entreprise</h2>
                        <button className="btn">Commencer</button>
                    </div>
                </div>
            </div>
        </div>
    );

    
}

export default MainContent;
